class MyMap {
	constructor(){

	}

	set(key,value){
		// TODO replace

			if(this.list[i].key===key){

			}
		}

	}
	get(key){
		// TODO replace
		for(let i=0; i<this.list.length; i++){
			if(this.list[i].key===key){

			}

	}
}
